import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1> Hello world! </h1>
      <p>This is a pragraph</p>
      <ul>
        <li>Coffee</li>
        <li>Tea</li>
        <li>Coke</li>
      </ul>
    </div>
  );
}

export default App;
